description:
Color Blind (Nick Orleans / Adam and Eve / 2002)

Love comes in all kinds of color. Trent is smart, handsome and a racist. When he loses his eye sight his wife leaves him and he falls for two hot and horny chicks who just happen to be Asian and Latina! Will they be able to change his mind about stereotypes?

Caroline Pierce, Angelica Costello, Mia Smiles, Dee, Gina Ryder, Flick Shagwell, Jasmine Klein, Nikita Denise, Dillon Day, Mr. Marcus, Steven St. Croix, Ian Daniels, Lee Stone

All Sex, Feature

